        private static double[,] GenerateRandomDistances(int numCities)
        {
            double[,] distances = new double[numCities, numCities];
            Random random = new Random();

            for (int i = 0; i < numCities; i++)
            {
                for (int j = i; j < numCities; j++) // Solo llena la mitad superior o diagonal de la matriz
                {
                    if (i == j)
                    {
                        distances[i, j] = 0;
                    }
                    else
                    {
                        double randomDistance = random.Next(50, 200);
                        distances[i, j] = randomDistance;
                        distances[j, i] = randomDistance; // Asigna el mismo valor a la posición simétrica
                    }
                }
            }

            return distances;
        }
